import './LogInPage.scss'

const LogInPage = () => {
  return (
    <div className='login-page'>
      <div className='login-page-container'>
        <div className='login-logo'>logo</div>
        <div className='login-forms'>forms</div>
      </div>
    </div>
  )
}

export default LogInPage;
